import logo from './logo.svg';
import './App.css';
import { Route, Link } from "react-router-dom";
import AllEvents from './AllEvents';

function App() {
  return (
    <div className="App">
      <header>
        <h1>
          <a href='/'> TicketKing</a>
        </h1>
        <Route path='/' exact component={AllEvents}/>
      </header>
    </div>
  );
}

export default App;
